import React from 'react'
import styled from 'styled-components'
import Pin from './Pin'

function Mainboard(props) {

  let { pins } = props

  return (
    <Wrapper>
      <container>
        {pins.map((pin) => {
          let { urls } = pin;
          return <Pin urls={urls} />
        })}

      </container>

    </Wrapper>
  )
}

export default Mainboard

const Wrapper = styled.div`
  display: flex;
`; 

const container = styled.div`
  display: flex;
`
